        Description: "Библиотека № 1 имени А.С. Грибоедова 1. Городская бесплатная библиотека-читальня им.А.С.Грибоедова была учреждена решением Московской Городской Думы по ходатайству 12 гласных в 1910 году. Первоначально библиотека располагалась на границе Сущевской и Мещанской частей города, в доме Мотова, на углу Самарского и Орловского переулков и состояла из двух комнат - абонемента и читального зала. В октябре 1911 года городская библиотека-читальня переводится в новое помещение, втрое большее по площади, в Больничном переулке, дом 7 Благотворительного общества (между 1-й и 3-й Мещанскими улицами). В этом здании библиотека работала до 1968 года. В ноябре 1911 года начало функционировать детское отделение, которое в 1968 году стало самостоятельной детской библиотекой № 46 им. А.С.Грибоедова. В настоящее время библиотека является Библиотекой №1 им. А.С.Грибоедова ГБУК г.Москвы\"ЦБС ЦАО\". 2. Основные проекты, реализуемые в 2016 г., : VARIO: Кино. Литература. Театр Совместный творческий проект с ВГИКом. Творческие встречи, презентации, мастер-классы; «А.С.Грибоедов – послание XXI веку» популяризации жизни и творчества А.С. Грибоедова, сохранение памяти о героях Отечества, развитие патриотических, духовно-нравственных и эстетических чувств детей и молодёжи к отечественной истории, литературе, культуре, связи времён, проблем и событий, освещение дипломатической деятельности А.С. Грибоедова. 3. Универсальный фонд 86 166 экземпляров.",
