        Description: "Отдел \"Культурный центр им. В.Я. Вульфа\" 1. Библиотека сформирована на базе передвижных книжных фондов двух библиотек (бывшего Свердловского и Дзержинского районов). Библиотека Свердловского р-на организована в 1939 г., Дзержинского – в 50-е годы. В 1967 г. эти две библиотеки преобразованы в библиотеку-филиал № 3 \"Передвижной фонд\" с постоянным адресом: Банный переулок, дом 4. В таком качестве библиотека просуществовала около тридцати лет, обслуживая более 150 организаций Дзержинского и других районов Москвы. С 1998 года библиотека работала как библиотека-филиал №3 \"Социально-правовая\". В декабре 2011 года Департамент культуры города Москвы принял решение о присвоении Библиотеке имени Виталия Яковлевича Вульфа, искусствоведа, театроведа, киноведа, литературоведа, переводчика, телеведущего. С 2015 года Библиотека им. В.Я. Вульфа вошла в состав Библиотеки №1 имени А.С. Грибоедова ГБУК г. Москвы \"ЦБС ЦАО\" как «Культурный центр им. В.Я. Вульфа». 2. Основные проекты, реализуемые в 2016 г.: «Молодые голоса» - популяризация творчества студентов и выпускников музыкальных учебных заведений города Москвы. Концерты, конкурсы, вокальные мастер-классы; «VARIO: Кино. Литература. Театр» - Совместный творческий проект с ВГИКом. Творческие встречи, презентации, мастер-классы; «Набираем высоту!» - Совместный творческий проект с ТСПХ (Творческий союз профессиональных художников): презентации выставок, встречи с художниками, мастер-классы. 3. Универсальный фонд 12 610 экземпляров с элементами специализации: кино, театр, искусство",
