        Description: "Отдел \"Культурный центр милосердия и толерантности им. Ф.П. Гааза\" 1. Библиотека №134 была открыта для читателей в конце 40 – х годов XX века на рабочей окраине старой Москвы – в Пролетарском районе. В 80 – е годы после централизации Библиотека стала филиалом ЦБС № 7 Таганского района и называлась: «Библиотека – филиал № 134 - Центр внестационарного обслуживания ветеранов, инвалидов и пожилых людей». В 1991 году в Библиотеке открывается Клуб «Милосердие», целью которого было проведение лекций, бесед, консультаций, экскурсий, благотворительных вечеров для ветеранов, инвалидов и пожилых людей под девизом «Спешите делать добро». В создании Клуба принимал участие Совет ветеранов Таганского района. В 2012 году при Библиотеке открылся Культурный центр милосердия и толерантности имени Федора Петровича Гааза – врача немецкого происхождения, гуманиста, филантропа, известного под именем «Святой доктор» с экспозицией о нем. В 2015 году Библиотека стала отделом «»Культурный центр милосердия и толерантности имени Ф. П. Гааза» Библиотеки №16 ГБУК г. Москвы \"ЦБС ЦАО\" 2.Основные проекты, реализуемые в 2016 году: «Шаг навстречу…» - проект, включает в себя военно–патриотические мероприятия для детей и подростков, посвященных юбилейным и памятным событиям военной истории России при участии ветеранов войны (благотворительные праздники, экскурсии, встречи, вечера воспоминаний, акции) и развлекательные программы для ветеранов; «Диалог культур» - Проект включает в себя культурно–просветительские, исторические, художественные, музыкальные мероприятия: проведение фольклорных праздников, фестивалей, мастер – классов русских национальных ремесел и рукоделия, выставок – показов старинных костюмов и предметов обихода, художественных выставок декоративно – прикладного искусства; «Спешите делать добро» - объединение общественных организаций города Москвы для совместной работы над увековечиванием памяти Ф. П. Гааза (проведение конференций, благотворительные концерты и спектакли, экскурсии, тематические встречи, участие в празднике для детей – сирот у памятника «Святому доктору» в Малом Казенном переулке, презентация новых и регулярный показ уже существующих фильмов о Ф. П. Гаазе); «Библиоквартирник» - программа включает в себя мероприятия молодежной самодеятельности: открытые микрофоны для начинающих поэтов, творческие встречи, музыкальные импровизации, выставки. Цель программы: раскрыть потенциал и стимулировать развитие молодых поэтов, музыкантов, художников, писателей. 3. Универсальный фонд 23 344 экземпляра с элементами специализации: милосердие и толерантность",
