        LibraryName: "Библиотека № 16 Отдел Библиотека префекта",
        Description: "Библиотека префекта ЦАО 1. Библиотека Префекта ЦАО была создана в 2008 г. как центр общественного доступа к информации о деятельности окружных и городских органов исполнительной власти и местного самоуправления, т.е. как одна из форм реализации «социального заказа». Поддержка Префектуры позволила создать современный Центр социально-правовой, экономической и политической информации с выделенным историко-краеведческим направлением – Отделом истории Центрального округа. До 2011 года Библиотека префекта ЦАО работала в режиме читального зала. В том же году произошло преобразование Библиотеки префекта ЦАО в «Открытый информационно-правовой центр – Библиотеку префекта ЦАО». В настоящее время Библиотека префекта ЦАО входит в структуру Библиотеки № 16 ГБУК г. Москвы «ЦБС ЦАО». 2.Основные проекты, реализуемые в 2016 году: «Политика для людей» - проект направлен на повышение политической грамотности и культуры жителей Москвы через взаимодействие с органами исполнительной власти и местного самоуправления и просветительских мероприятий: лекций, дискуссий, посвященных политическому прошлому и настоящему России, встречи с историками, политологами, депутатами Государственной Думы, представителями Управы и Префектуры; «Литературная Москва» - литературно-экскурсионный проект, предусматривает проведение пешеходных экскурсий по литературным местам Таганки, а также автобусных экскурсий различных районов города «Москва Серебряного века» для людей с ограниченными возможностями здоровья; «Прогулкино» - цикл пешеходных экскурсий к Году кино по местам съемок художественных фильмов: высотное здание на Котельнической набережной, к/т «Иллюзион», история отечественного кино, кинотеатры Таганки в прошлом и настоящем; «Снимаем кино!» - творческие встречи, мастер-классы, знакомство с кинопрофессиями, запись в детскую студию. Ведущий режиссер-постановщик, руководитель Детского творческого объединении «Теле-кино» Д.Спиридонов; «Кино-Контакт» - авторская мастерская режиссера-мультипликатора В.Тарасова, где дети изучают основы анимационного искусства, учатся делать собственные мультфильмы.3. Универсальный фонд 21 310 экземпляров с элементами специализации: общественно-политическая и краеведение",
