        Description: "Отдел по работе с молодежью 1. Библиотека была создана в 20-х годах прошлого века. Находилась она на первом этаже жилого дома по Сибирскому проезду, дом 6. Большая часть книжного фонда Библиотеки была собрана из книг разоренных купеческих домов. В1968 году, практически на том же месте, было построено новое помещение для Библиотеки по адресу Малая Калитниковская, дом 22. В 1920 году Библиотеке было присвоено имя В.Г.Белинского, о чем свидетельствует запись летописи архива МГУ т.1, с. 536: «Имя В.Г.Белинского в 1920 г. было присвоено улице, спецшколе №119, библиотеке на Калитниковской улице». В настоящее время Библиотека им. В.Г. Белинского является структурным подразделением Библиотеки № 16 ГБУК г. Москвы \"ЦБС ЦАО\" 2.Основные проекты, реализуемые в 2016 году: «Белинский – великий русский критик» - моно-проект направлен на популяризацию творческого наследия и увековечивания памяти писателя и критика В.Г. Белинского; «Молодые – молодым!» - главная задача образовательного проекта очень проста – нам есть чему поучиться друг у друга! В библиотеке создана творческая атмосфера, которая дает возможность проявлять себя и делиться своими идеями, достижениями, проектами, знаниями; «Библиотека выбор точка ru!» - долгосрочная программа действий, направленная на профориентацию, помощь в выборе профессии, реализацию творческих ресурсов молодежи, помощь в образовании и саморазвитии, организации общедоступной и интеллектуально-досуговой среды. 3. Универсальный фонд 20 477 экземпляров с элементами специализации: литература и искусство молодых",
