        Description: "Библиотека № 19 имени Ф.М. Достоевского 1. Библиотека на Чистопрудном бульваре в доме № 23 – одна из старейших общедоступных (публичных) в Москве, основана в 1907 году с названием «Современная библиотека». С 1921 года носит имя Ф.М. Достоевского. Библиотека оснащена удобной мебелью и информационным оборудованием, беспроводным и бесплатным Wi-Fi. Проектом также запланирована работа электронной системы записи в библиотеку и поиска книг, для чего все издания снабжаются RFID-кодами. С 2013 годаБиблиотека № 19 имени Ф.М. Достоевского является структурным подразделением ГБУК г. Москвы \"ЦБС ЦАО\".2.Основные проекты, реализуемые в 2016 году: Проект «Редсовет (AGORA)» - встречи независимых издательств «Логос», «Праксис», «Культурная революция», «Ad Marginem»; Проект «Анатомия философии: как работает текст» - работа с текстовым материалом; «КИНОТЕКСТ» - сценарный питчинг (презентации кинопроектов); Образовательный проект экскурсионного агентства «Трипстер» - лекции на тему искусства; Студия «Art in Time» - психологические тренинги и консультации по методике нарт-терапии (метод психологической помощи, основанный на творческом самовыражении, использующий различные виды искусства (художественное творчество, музыка, танцы, драма литературное творчество и многое другое); «Сторителлинг-фестиваль» - составление рассказа на английском языке для учащихся русских и шотландских школ; «Лига роботов» - образовательный проект и мастер-классы по робототехнике; «Бабушка-блоггер» - курсы компьютерной грамотности для пенсионеров. 3. Универсальный фонд 38 150 экземпляров с элементами специализации: москвоведение",
