        Description: "Отдел семейного чтения 1. Отдел семейного чтения - универсальная библиотека, прививает культуру чтения в семье, сохраняет и пропагандирует культурное, историческое и духовное наследие Арбата. Библиотека обслуживает читателей любого возраста, профессии, образования и т.д. С 2013 года Библиотека №3 им. Н.А. Добролюбова Отдел семейного чтения является структурным подразделением ГБУК г. Москвы \"ЦБС ЦАО\".2. Основные проекты, реализуемые в 2016 г.: «Классика: далекая - близкая» - популяризация и пропаганда русского языка и литературы, развитие культуры чтения; «Человек читающий», посвященный Году кино в РФ - повышение качества и общественного значения кинематографа, популяризация чтения как формы досуга; «Война. Народ. Победа» - привитие основополагающих ценностей, идей, убеждений; увековечение подвига многонационального народа в Великой Отечественной войне; «Наследие хоровых мастеров» - воспоминания известных музыкантов, знакомство с творчеством российских и зарубежных хоровых коллективов, прослушивание записей из фондов фонотеки, дискуссии; Музыка - универсальный язык общения» - знакомство с прошлой и современной музыкальной жизнью Арбата, тематические концерты студентов и выпускников музыкальных учебных учреждений Москвы для всех любителей и ценителей музыки; «Арбат - пересечение культур» - приобщение к историческим, культурным и нравственным ценностям; сохранение семейных традиций воспитания в духе культурно-исторического наследия Арбата. 3. Универсальный фонд 31 475 экземпляров с элементами специализации: литература на иностранных языках; ноты, музыкальная литература; детская литература",
