        LibraryName: "Библиотека № 4 им. Е.А. Фурцевой",
        Description: "Библиотека № 4 имени Е.А. Фурцевой 1. Библиотека № 4 имени Екатерины Алексеевны Фурцевой – одна из старейших библиотек Москвы. Она была образована в 1919 году как «библиотека семейного чтения», то есть обслуживала и детей, и взрослых. В 1956 году «взрослый» фонд этой библиотеки переехал в здание на Фрунзенской набережной, ставший самостоятельной библиотекой для взрослых. В 2005 году Правительством Москвы было принято решение об увековечении памяти Екатерины Алексеевны Фурцевой, видного государственного, политического и общественного деятеля. Библиотеке было присвоено имя этой женщины, занимавшей пост министра культуры СССР с 1960 до 1974 года и немало сделавшей для развития культуры и искусства в нашей стране. В настоящее время Библиотека № 4 имени Е.А. Фурцевой – самая крупная общедоступная публичная библиотека для взрослых, расположенная в районе Хамовники. Входит в состав ГБУК г. Москвы \"ЦБС ЦАО\" 2. Основные проекты, реализуемые в 2016 г.: «Гостиная министра» - Организация мероприятий, посвященных истории культуры России ХХ века и связанные с деятельностью министра культуры СССР Е.А. Фурцевой; «Клуб анонимных писателей» - совместный литературный проект с журналом «Русский пионер» с приглашением известных писателей (Дмитрий Быков, Владислав Отрошенко, Алексей Варламов и т.д.); «Digital School» - образовательный проект по актерскому мастерству для детей и подростков; «Кукольная миниатюра» - выставка кукол в стенах библиотеки. 3. Универсальный фонд 60 806 экземпляров с элементами специализации \"Культура России XX века\"",
