        Description: "Библиотека № 6 имени В.В. Вересаева 1. Свой отсчёт в истории она ведёт с 30-х годов ХХ века как учреждение, входящее в систему библиотек отдела культуры Фрунзенского района столицы. С 1937 года Библиотека существовала при кабинете политпросвещения Ленинского района, и её основной миссией было информирование партийных работников о новинках литературы и периодики. В 1976 году Библиотека обрела свой постоянный адрес - Ружейный переулок, дом 4. С этого же года фонд Библиотеки - универсальный. Гордостью фонда являются редкие книги: прижизненные издания В.В. Вересаева, переданные в дар его родственниками и наследниками. К памятникам книжной культуры мы относим и имеющуюся у нас \"Библиотеку политкаторжан и ссыльнопоселенцев\", и книги, увидевшие свет в издательстве \"Academia\". В 1991 году, к 125-летию со дня рождения В.В. Вересаева, по решению Правительства Москвы Библиотеке было присвоено имя писателя (Распоряжение Правительства Москвы № 1167-РП от 16.12.1991 г.). Комиссию по присвоению имени возглавлял академик Д.С. Лихачёв. Библиотека №6 имени В.В. Вересаева является структурным подразделением ГБУК г. Москвы \"ЦБС ЦАО 2.Основные проекты, реализуемые в 2016 г.: «Медицинская этика» - новые подходы к эффективному обмену медицинской информацией, расширение связей в области междисциплинарных взаимодействий, постоянный диалог между врачами разных специальностей и всеми, кто интересуется вопросами медицины; «Живая жизнь» - российские и международные выставочные проекты профессиональных и молодых художников; круглые столы, философские вечера и мастер-классы; «Вересаевский клуб» - популяризация имени и творческого наследия В.В. Вересаева, исследовательская деятельность; салон искусств «Lomonosov ART» - предоставление поэтам и музыкантам возможности поделиться своим творчеством. музыкальный салон «Элегия» - просветительство в области классического музыкального искусства; «Серебряный рассвет» - литературный клуб. Проведение литературно-музыкальных мероприятий связанных с жизнью и творчеством выдающихся писателей и поэтов; киноклуб «Обыкновенное чудо» - проект основывается на совмещении двух видов искусств - кино и литературы с участием актеров, режиссеров отечественного кинематографа. 3. Универсальный фонд 24 618 экземпляров с элементами специализации: медицина",
