        Description: "Библиотека № 9 имени Н.В. Гоголя 1. Библиотека имени Н. В. Гоголя была открыта 20 марта (1 апреля) 1909 года к 100-летнему юбилею писателя. В первые послереволюционные годы главной задачей библиотеки становится ликвидация безграмотности населения. В тридцати девяти школах ликбеза библиотека организует, громкие читки, беседы, знакомит учащихся с книгами по любым отраслям знаний. Её передвижной фонд обслуживал почти сто организаций Пресненского района. С начала 1941 г. библиотека получает новое официальное название — «Районная библиотека № 46 имени Н. В. Гоголя Советского района г. Москвы». В военное время библиотека ведет обслуживание читателей вне своих стен — в бомбоубежищах, на станции метро «Маяковская», в подшефных госпиталях, опорных пунктах ополчения. В послевоенные годы библиотека становится одним из важнейших культурных центров Пресненского района. Сегодня она превратилась из обычной народной читальни в современную библиотеку с постоянно обновляющимся фондом книг, журналов, богатой коллекцией различных изданий произведений Н. В. Гоголя, материалами о его жизненном и творческом пути, залами для проведения культурно-массовых мероприятий, современной компьютерной техникой. В настоящее время Библиотека №9 им. Н.В. Гоголя является структурным подразделением ГБУК г. Москвы \"ЦБС ЦАО\" 2.Основные проекты, реализуемые в 2016 г.: «Вечно Ваш, Гоголь» - книжные экспозиции; формирование специализированного фонда изданий о жизни и творчестве Н.В. Гоголя; сбор, систематизация и оформление архива публикаций о жизни и творчестве Н.В. Гоголя; проведение музыкально-литературных программ с целью популяризации творчества Н.В. Гоголя \"Н.В. Гоголь в кино»: цикл программ-лекций: рассказ о фильмах, режиссерах, актерах, кинопоказы и обсуждения; «Адаптация пожилого человека» - обучение основам компьютерной грамотности; организация досуга: тематические литературно-музыкальные и театральные вечера; встречи со специалистами - врачами, психологами, работниками социальной сферы; «Маленький город» - расширение кругозора малышей; занятия иностранными языками; развивающие игры; различные тематические кружки и курсы в помощь культурного развития ребенка, семейные праздники литературные викторины; «Н.В. Гоголь в кино» - в рамках сетевого проекта библиотек Москвы \"Город в кадре\" - цикл программ-лекций: рассказ о фильмах, режиссерах, актерах, кинопоказ и обсуждение; «Победа – непридуманные истории» Основная цель проекта - способствовать историко-культурном и патриотическому воспитанию населения и гостей cтолицы, развитию библиотечного дела, привлечению большего количества пользователей в библиотеки ГБУК г. Москвы «ЦБС ЦАО», возрождение связи поколений, и сохранению исторического и культурного наследия, реализуется совместно с Региональной общественной организацией «Бессмертный полк – Москва». книжные экспозиции; формирование специализированного фонда изданий о жизни и творчестве Н.В. Гоголя; сбор, систематизация и оформление архива публикаций о жизни и творчестве Н.В. Гоголя; проведение музыкально-литературных программ с целью популяризации творчества Н.В. Гоголя \"Н.В. Гоголь в кино»: цикл программ-лекций: рассказ о фильмах, режиссерах, актерах, кинопоказы и обсуждения . 3. Универсальный фонд 83 515 экземпляров",
